DROP TABLE IF EXISTS `worker`;
CREATE TABLE `worker` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `worker_id` varchar(20) NOT NULL DEFAULT '' COMMENT '工号',
  `name` varchar(255) NOT NULL DEFAULT '' COMMENT '工人姓名',
  `phone` varchar(20) NOT NULL DEFAULT '' COMMENT '工人联系方式',
  `flag` int(11) NOT NULL DEFAULT '1' COMMENT '0为不存在，1为存在',
  PRIMARY KEY (`Id`),
  UNIQUE KEY `worker_id` (`worker_id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='通用实体-员工信息表';

